import "./App.css";
import MenuNav from "./components/landing/MenuNav";

function App() {
  return (
    <>
      <img
        src={
          "https://photos.google.com/album/AF1QipO0trj7bMlTbYRjAzZIfCypTdRmndrLZlDrRWFp/photo/AF1QipPwgPBR6wH3PL_XjCGuqeTndeVJrXgdxonVeC6W"
        }
        alt=""
      />
      <div className="container-fluid">
        <div className="row">
          <div className=" col-lg-2 menu">
            <MenuNav />
          </div>
          <div className="col-lg-10"></div>
        </div>
      </div>
    </>
  );
}

export default App;
